import React, { Component } from 'react'
import styles from '../../ProfileBlocks.module.css';
import { Container, Row } from 'react-bootstrap';
import ProfileCardTeacher from '../ProfileCardTeacher/ProfileCardTeacher';
import RequestsCard from '../RequestsCard/RequestsCard'; 
import TeacherDocumentsCard from '../TeacherDocumentsCard/TeacherDocumentsCard'; 
import ThemesCard from '../../ThemesCard/ThemesCard';

export default class ProfileBlocksTeacher extends Component {
    
  render() {
    const tableData = this.props.tableData
    const teacherData = this.props.data
    const type_of_user = teacherData.type_of_user
    const fullname = teacherData.surname + ' ' + teacherData.name + ' ' + teacherData.patronymic

    const requestsdata = {
        name: 'Едунова Мария Алексеевна',
        group: 'КИ20-12Б',
        rating: '4,97',
        topic: 'Разработка клиентской части системы автоматизации процессов ГИА',
        type: 'комплексная',
        additional: 'Общая тема комплексной ВКР: Разработка системы автоматизации процессов ГИА.Второй участник комплексной ВКР Замыслова Светлана',
    };

  
    
    return (
    <Container>
      <Row className="p-4">
      <div class={styles.left_column}>

       <ProfileCardTeacher teacherData={teacherData}/>
        </div>
        <div class={styles.right_column}>
            <RequestsCard requestsdata={requestsdata}/>
        <TeacherDocumentsCard/>
        <ThemesCard tableData={tableData} name={fullname} type_of_user={type_of_user}/>
        </div>
      </Row>
      </Container>
    )
  }
}
